script: |
  super -f text -I q9618.spq | sort > q9618.out

inputs:
  - name: q9618.spq
    data: |
      SELECT + 38 AS col2 FROM tab2 (FORMAT parquet) WHERE NOT + 11 * + 37 >= - ( col2 ) * col2 / - 11 + - - 55 * + col1;
  - name: tab2

outputs:
  - name: q9618.out
    data: |
      38
      38
      38
